import './ExpenseItems.css';
const ExpenseItems = () => {
    return (
        <div className="expenseitem_main">
            <div>March 28, 2023</div>
            <div>
                <div>Car test</div>
                <div>$202.02</div>
            </div>
        </div>
    );
}

export default ExpenseItems;
